import { FC, useState } from 'react';

import { AddButton, CustomModal } from '@components';

import { TripsCard } from '../Card';

import style from './TripsCatalog.module.scss';

const TRIPS = [
  {
    city: 'Berlin',
    date: '14.07.2023 - 21.07.2023',
    id: '01',
    url: 'data:image/jpeg;base64,',
  },
  {
    city: 'Tokyo',
    id: '02',
    date: '14.07.2023 - 21.07.2023',
    url: 'data:image/jpeg;base64,',
  },
  {
    city: 'Barcelona',
    id: '03',
    date: '14.07.2023 - 21.07.2023',
    url: 'https://api.time.com/wp-content/uploads/2023/03/Worlds-Greatest-Places-Barcelona-Spain.jpg',
  },
];

export const TripsCatalog: FC = () => {
  const [isVisible, setVisible] = useState(false);

  const handleModal = (arg?: boolean) => {
    if (arg) {
      setVisible(arg);
      return;
    }
    setVisible((prev) => !prev);
  };

  return (
    <div className={style.trips_catalog}>
      {TRIPS.map(({ city, date, url, id }) => (
        <TripsCard
          key={id}
          city={city}
          date={date}
          url={url}
        />
      ))}

      {/* ADD BUTTON HERE */}
      <div>
        <AddButton onClick={() => handleModal(true)} />
      </div>

      <CustomModal
        isVisible={isVisible}
        handleModal={handleModal}
      >
        <div> Create Trip Form </div>
      </CustomModal>
    </div>
  );
};
